import React from 'react';
import { Form, Accordion } from 'semantic-ui-react';

function PrivacySettingsAccordion({ handleToggleEmailNotifications }) {
  const panels = [
    {
      key: 'privacy',
      title: 'Настройки приватности',
      content: {
        content: (
          <Form>
            <Form.Field>
              <label>Email</label>
              <input placeholder='' />
            </Form.Field>
            <Form.Field>
              <Form.Checkbox label='Присылать уведомления по Email' />
            </Form.Field>
            <Form.Field>
              <label>Номер телефона</label>
              <input placeholder='' />
            </Form.Field>
            <Form.Field>
              <a href="#" onClick={() => console.log('Change password')}>Изменение пароля</a>
            </Form.Field>
            <button>Применить</button>
          </Form>
        ),
      },
    },
  ];

  return <Accordion as={Form.Field} panels={panels} onClick={handleToggleEmailNotifications} />;
}

export default PrivacySettingsAccordion;
